function letterGen () {
    var text = "";
    var letters = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";

    for (var i = 0; i < 2; i++) {
        text += letters.charAt(Math.floor(Math.random() * letters.length));
    }
    return text;
}
function genTelaio(length) {
    let telai=[];
    let k=0;
    var result           = '';
    var characters       = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789';
    var charactersLength = characters.length;
    while(k<600) {
        for (var i = 0; i < length; i++) {
            result += characters.charAt(Math.floor(Math.random() * charactersLength));
        }
        if(telai.includes(result)){
            continue;
        }else{
            telai.push(result);
            result='';
            k++;
        }
    }
    return telai;
}

function randomDate(start, end) {
     let tmpDate=new Date(start.getTime() + Math.random() * (end.getTime() - start.getTime()));
    var dd = String(tmpDate.getDate()).padStart(2, '0');
    var mm = String(tmpDate.getMonth() + 1).padStart(2, '0'); //January is 0!
    var yyyy = tmpDate.getFullYear();

    tmpDate = dd + '/' + mm + '/' + yyyy;
    return (tmpDate);
}


function generateTarghe(){
    let targhe=[];
    let i=0;
    while(i < 600) {
        let prefisso_targa = letterGen();
        let fine_targa = letterGen();
        let numeri = (Math.floor(Math.random(900)) + 100).toString();
        let targa=prefisso_targa+numeri+fine_targa;
        if(targhe.includes(targa)){
            continue;
        }else{
            targhe.push(targa);
            targa='';
            i++;
        }
    }
    return targhe
}
